\begin{tikzpicture}

% Draw the grid
\foreach \x in {1,2,3,4} {
    \foreach \y in {1,2,3,4} {
        \draw (\x, \y) -- (\x+1, \y);
        \draw (\x, \y) -- (\x, \y+1);
    }
}

% Label the grid lines
