\tikzmath{%
  function Ux(\t, \u, \v) {%
    real \a, \b, \c;
    if abs(\u)>.05 then {%
      \a = -2*ln(cosh(\u))/(\u*\u);
      \b = (\u -tanh(\u))/(\u*\u)*\v;
      \c = (tanh(\u)/\u)*(2 - tanh(\u)*\v);
    } else {%
      \a = 1 -2/3*\u*\v;
      \b = 8/15*pow(\u, 3)*\v;
      \c = 2/9*pow(\u, 4);
    };
    return {(\a +\b +\c)*\v};
  };
  function Uy(\t, \u, \v) {%
    real \a, \b;
    if abs(\u)>.05 then {%
      \a = ln(cosh(\u))/\u;
      \b = (tanh(\u) -\u)/\u;
      return {2*\a +2*\b*\v};
    } else {
      \a = 1 -pow(\u, 2)/3;
      \b = -(2/3)*\u +(4/15)*pow(\u, 3);
      return {\u*(\a +\b*\v)};
    };
  };
  function fUy(\u) {%
    real \a, \b;
    \a = ln(cosh(\u))/\u;
    \b = (\u -tanh(\u))/\u;
    return \a/\b;
  };
  function UxVF(\u, \v) {%
    real \a, \b, \c;
    if abs(\u)>.05 then {%
      \a = -2*ln(cosh(\u))/(\u*\u);
      \b = (\u -tanh(\u))/(\u*\u)*\v;
