  function fUx(\u) {%
    real \a, \b;
    \a = 2*(tanh(\u)/\u) -2*ln(cosh(\u))/(\u*\u);
    \b = -(\u -tanh(\u))/(\u*\u) +(tanh(\u)/\u)*tanh(\u);
